import React from 'react'
import { burger } from '../assets'
import { businessLinks } from '../constants'

const Menu = () => {
  return (
    <div className='p-10'>
    <div className='card--shadow grid grid-cols-5'>
     {businessLinks.map((business) => (<div>
      <img src = {business.image} alt="burger" className='h-[200px] w-[200px]'></img>
      <p className='text-white'>{business.content}</p>
      </div>))}

    </div>
    </div>
  )
}

export default Menu
